import React from 'react'

function MySection() {
  return (
    <section className='p-44'>
      <h3 className='text-4xl'>Selamat Datang</h3>
      <h1 className='text-5xl font-bold'>Saya adalah Ahmad Wahyudi</h1>
      <h5 className='text-3xl text-[#EDA751]'>UI/UX Designer</h5>
      <p className='text-[#676767] text-lg mt-8 mb-20 w-80'>Hello, I am an aspiring UI/UX designer with the ability to translate the designs into functional Front-end</p>

      <button className='bg-[#EDA751] text-white rounded-lg px-8 py-2 shadow-lg'>Hire Me</button>
    </section>
  )
}

export default MySection
